function fidelity(ρ, σ)
    ρ = ρ/norm(ρ)
    σ = σ/norm(σ)
    f = abs(conj(transpose(ρ))*σ)^2
    f
end

function gaussian(σ1, σ2)
    function func(ρ, ϕ)
        x = ρ*cos(ϕ)
        y = ρ*sin(ϕ)
        exp(-x^2/σ1^2 + -y^2/σ2^2)
    end
end

